import React, { Component } from "react";


class General extends Component{
    constructor(props){
        super(props)
    }

    render(){
        const {generals} = this.props;
        return(
            <div>
                {generals.map((general) => {
                    return (
                        <div>
                            <h1 key={general.id}>{general.name}</h1>
                            <label></label>
                        </div>
                    )
                })}
            </div>  
        )
    }
}

export default General
